const TableHeader = ({ columns }) => {
  return (
    <>
      <thead>
        <tr>
          {columns.map((col) => {
            return (
              <>
                <th>{col.label} <i className="bi bi-sort-down"></i></th>
              </>
            );
          })}
        </tr>
      </thead>
    </>
  );
};

export default TableHeader;
